import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter, UserRoute, Switch, Route } from "react-router-dom";
import UserProvider from './context/UserProvider.js'

ReactDOM.render(
    <BrowserRouter>
        <UserRouter>
            <App/>
        </UserRouter>
    </BrowserRouter>
, document.getElementById("root"));
